                                        (event) => {
                                            setEmail(event.target.value)
                                            }
                                        }
                                    />
                                </div>
                                <div className = "dados">
                                <input type = "password" 
                                    placeholder = "Digite sua senha"
                                //  value = {password}
                                    />
                                </div>
                                <div className = "buttonAuth" >
                                <button type="submit" >
                                    Entrar
                                </button>
                                </div>
                            </form>
                        </div>
                    </main>

                    </div>



    )
}
